import {useState} from "react";
import "./App.css";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "23-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "23-10-10", fvk: "MD"},
  ]);
  //  state för ny patient - start in = input
  const [inPlats, setInPlats] = useState("");
  const [inDatum, setInDatum] = useState("");
  const [inKontakt, setInKontakt] = useState("");

  //  state för redigering
  const [editPlats, setEditPlats] = useState("");
  const [editKontak, setEditKontak] = useState("");

  //funktioner som ska vara i appen
  function deletePatient(id) {
    setPatienter((nuvPatienter) => {
      return nuvPatienter.filter((p) => p.id !== id);
    });
  }

  function handleSubmit(e) {
    e.preventDefault();
    const nyPatient = {
      id: new Date().getTime(),
      plats: inPlats,
      datum: inDatum,
      fvk: inKontakt,
    };
    setPatienter((currentP) => {
      return [...currentP, nyPatient];
    });
  }

  return (
    <div className="App">
      <h1>Teest</h1>
      <br />
      {/* ny patient form - start */}
      <div className="card">
        <form onSubmit={handleSubmit}>
          <div className="form-container">
            <div className="va-container">
              <input
                type="text"
                value={inPlats}
                onChange={(e) => setInPlats(e.target.value)}
              />
              <input
                type="text"
                value={inKontakt}
                onChange={(e) => setInKontakt(e.target.value)}
              />
              <input />
            </div>
            <div className="ho-container">
              <input
                type="date"
                value={inDatum}
                onChange={(e) => setInDatum(e.target.value)}
              />
              <input />
              <input />
            </div>
          </div>
          <div className="btn-container">
            <button>Spara</button>
          </div>
        </form>
      </div>

      {/* ny patient form - END */}

      {/* tabell av patienter */}
      <table className="table">
        <thead>
          <tr>
            <th>Plats</th>
            <th>Datum</th>
            <th>FVK</th>
          </tr>
        </thead>
        <tbody>
          {patienter.map((p) => {
            return (
              <tr key={p.id}>
                <td>{p.plats}</td>
                <td>{p.datum}</td>
                <td>{p.fvk}</td>
                <td>
                  <button
                    className="btn-delete"
                    onClick={() => deletePatient(p.id)}
                  >
                    X
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default App;
